import SPCertificate from './certificate';
import SPTranscript from './transcript';

const templates = [
  {
    id: 'certificate',
    label: 'Certificate',
    template: SPCertificate
  },
  {
    id: 'transcript',
    label: 'Transcript',
    template: SPTranscript
  }
];

export default templates;
